import "./KyberDmmSampler.sol";
import "./LiquidityProviderSampler.sol";
import "./MakerPSMSampler.sol";
import "./MStableSampler.sol";
import "./MooniswapSampler.sol";
import "./NativeOrderSampler.sol";
import "./ShellSampler.sol";
import "./TwoHopSampler.sol";
import "./UniswapSampler.sol";
import "./UniswapV2Sampler.sol";
import "./UniswapV3Sampler.sol";
import "./UtilitySampler.sol";

import "@0x/contracts-erc20/contracts/src/v06/IEtherTokenV06.sol";

contract ERC20BridgeSampler is
    BalancerSampler,
    BalancerV2Sampler,
    BancorSampler,
    CurveSampler,
    DODOSampler,
    DODOV2Sampler,
    Eth2DaiSampler,
    KyberSampler,
    KyberDmmSampler,
    LiquidityProviderSampler,
    MakerPSMSampler,
    MStableSampler,
    MooniswapSampler,
    NativeOrderSampler,
    ShellSampler,
    TwoHopSampler,
    UniswapSampler,
    UniswapV2Sampler,
    UniswapV3Sampler,
    UtilitySampler
{

    struct CallResults {
        bytes data;
        bool success;
    }

    constructor(IEtherTokenV06 weth)
        public
        BancorSampler(weth)
        CurveSampler(weth)
        KyberSampler(weth)
        MooniswapSampler(weth)
        UniswapSampler(weth)
    { }

    /// @dev Call multiple public functions on this contract in a single transaction.
    /// @param callDatas ABI-encoded call data for each function call.
    /// @return callResults ABI-encoded results data for each call.
    function batchCall(bytes[] calldata callDatas)
        external
        payable
        returns (CallResults[] memory callResults)
    {
        callResults = new CallResults[](callDatas.length);
        for (uint256 i = 0; i != callDatas.length; ++i) {
            callResults[i].success = true;
            if (callDatas[i].length == 0) {
                continue;
            }
            (callResults[i].success, callResults[i].data) = address(this).call(callDatas[i]);
        }
    }
}

