    {
        return _tradeZeroExBridge(
            IERC20TokenV06(sellToken),
            IERC20TokenV06(buyToken),
            takerTokenAmount,
            bridgeData
        );
    }

    /// @dev Sample sell quotes from an arbitrary on-chain liquidity provider.
    /// @param providerAddress Address of the liquidity provider.
